mongodb aggregate multiple arrays<p>I am using MongoDB version v3.4. I have a <code>documents</code> collection and sample datas are like this:    </p>

<pre><code>{
    "mlVoters" : [ 
        {"email" : "a@b.com", "isApproved" : false}
    ],
    "egVoters" : [ 
        {"email" : "a@b.com", "isApproved" : false}, 
        {"email" : "c@d.com", "isApproved" : true}
    ]
},{
    "mlVoters" : [ 
        {"email" : "a@b.com", "isApproved" : false}, 
        {"email" : "e@f.com", "isApproved" : true}
    ],
    "egVoters" : [ 
        {"email" : "e@f.com", "isApproved" : true}
    ]
}
</code></pre>

<p>Now if i want the count of distinct email addresses for mlVoters:    </p>

<pre><code>db.documents.aggregate([
  {$project: { mlVoters: 1 } },
  {$unwind: "$mlVoters" },
  {$group: { _id: "$mlVoters.email", mlCount: { $sum: 1 } }},
  {$project: { _id: 0, email: "$_id", mlCount: 1 } },
  {$sort: { mlCount: -1 } }
])
</code></pre>

<p>Result of the query is:</p>

<pre><code>{"mlCount" : 2.0,"email" : "a@b.com"}
{"mlCount" : 1.0,"email" : "e@f.com"}
</code></pre>

<p>And if i want the count of distinct email addresses for egVoters i do the same for egVoters field. And the result of that query would be:</p>

<pre><code>{"egCount" : 1.0,"email" : "a@b.com"}
{"egCount" : 1.0,"email" : "c@d.com"}
{"egCount" : 1.0,"email" : "e@f.com"}
</code></pre>

<p>So, I want to combine these two aggregation and get the result as following (sorted by totalCount):</p>

<pre><code>{"email" : "a@b.com", "mlCount" : 2, "egCount" : 1, "totalCount":3}
{"email" : "e@f.com", "mlCount" : 1, "egCount" : 1, "totalCount":2}
{"email" : "c@d.com", "mlCount" : 0, "egCount" : 1, "totalCount":1}
</code></pre>

<p>How can I do this? How should the query be like? Thanks.</p>

