Provide limit on Spring Data Mongo repository<p>Using the latest Spring Data Mongo (2.1.1 at time of writing), how do I specify to get the first record of a &quot;custom&quot; query method? Here is an example:</p>
<pre><code>@Query(value=&quot;{name: ?0, approval: {'$ne': null}}&quot;,
        sort=&quot;{'approval.approvedDate': -1}&quot;,
        fields = &quot;{ _id: 1 }&quot;)
List&lt;Item&gt; getLatestApprovedIdByName(String name, Pageable pageable);

/**
 * Finds the id of the most recently approved document with the given name.
 */
default Item getLatestApprovedIdByName(String name) {
    return getLatestApprovedIdByName(name, PageRequest.of(0, 1)).stream()
                                                                .findFirst()
                                                                .orElse(null);
}
</code></pre>
<p>Ideally I could just annotate getLatestApprvedIdByName taking only the <code>String</code> parameter.</p>
<p>There doesn't seem to be a limit field on the <code>org.springframework.data.mongodb.repository.Query</code> annotation.</p>
<p>It seems odd because I can emulate everything the named methods do except <code>findFirst</code>.</p>
<p>Without the <code>Pageable</code>, I get <code>IncorrectResultSizeDataAccessException</code>, and returning a <code>List</code> is not acceptable because I don't want to waste time returning an arbitrarily large result, plus the complicated code needing to deal with the possibility of 0 or 1 items.</p>

